import React, { Component } from "react";
import { MDBDataTable } from "mdbreact";

const TableBody = (props) => {
  if (props.response == null) {
    const rows = (
      <tr key={1}>
        <td>No values are input yet!</td>
      </tr>
    );
    return <tbody>{rows}</tbody>;
  } else {
    const rows = props.response.nedbetalingsplan.innbetalinger.map(
      (row, index) => {
        return (
          <tr key={index}>
            <td>{row.dato}</td>
            <td>{Math.round(row.innbetaling) + "  NOK"}</td>
            <td>{Math.round(row.gebyr) + "  NOK"}</td>
            <td>{Math.round(row.renter) + "  NOK"}</td>
            <td>{Math.round(row.restgjeld) + "  NOK"}</td>
            <td>{Math.round(row.total) + "  NOK"}</td>
          </tr>
        );
      }
    );

    return <tbody>{rows}</tbody>;
  }
};

class Table extends Component {
  render() {
    const { response } = this.props;

    return (
      <div>
        <h1>Tabell</h1>
        <table className="table table-bordered table-hover">
          <thead className="thead">
            <tr>
              <th scope="col">Dato</th>
              <th scope="col">Innbetaling</th>
              <th scope="col">Gebyr</th>
              <th scope="col">Renter</th>
              <th scope="col">Restgjeld</th>
              <th scope="col">Terminkostnad</th>
            </tr>
          </thead>
          <TableBody response={response} />
        </table>
      </div>
    );
  }
}

class Table3 extends Component {
  render() {
    const { response } = this.props;
    const data = {
      columns: [
        {
          label: "Name",
          field: "name",
          sort: "asc",
          width: 150,
        },
        {
          label: "Position",
          field: "position",
          sort: "asc",
          width: 270,
        },
        {
          label: "Office",
          field: "office",
          sort: "asc",
          width: 200,
        },
        {
          label: "Age",
          field: "age",
          sort: "asc",
          width: 100,
        },
        {
          label: "Start date",
          field: "date",
          sort: "asc",
          width: 150,
        },
        {
          label: "Salary",
          field: "salary",
          sort: "asc",
          width: 100,
        },
      ],
      rows: [
        {
          name: "Tiger Nixon",
          position: "System Architect",
          office: "Edinburgh",
          age: "61",
          date: "2011/04/25",
          salary: "$320",
        },
        {
            name: 'Garrett Winters',
            position: 'Accountant',
            office: 'Tokyo',
            age: '63',
            date: '2011/07/25',
            salary: '$170'
          },
          {
            name: 'Ashton Cox',
            position: 'Junior Technical Author',
            office: 'San Francisco',
            age: '66',
            date: '2009/01/12',
            salary: '$86'
          },
          {
            name: 'Cedric Kelly',
            position: 'Senior Javascript Developer',
            office: 'Edinburgh',
            age: '22',
            date: '2012/03/29',
            salary: '$433'
          },
          {
            name: 'Airi Satou',
            position: 'Accountant',
            office: 'Tokyo',
            age: '33',
            date: '2008/11/28',
            salary: '$162'
          },
          {
            name: 'Brielle Williamson',
            position: 'Integration Specialist',
            office: 'New York',
            age: '61',
            date: '2012/12/02',
            salary: '$372'
          },
          {
            name: 'Herrod Chandler',
            position: 'Sales Assistant',
            office: 'San Francisco',
            age: '59',
            date: '2012/08/06',
            salary: '$137'
          },
          {
            name: 'Rhona Davidson',
            position: 'Integration Specialist',
            office: 'Tokyo',
            age: '55',
            date: '2010/10/14',
            salary: '$327'
          },
          {
            name: 'Colleen Hurst',
            position: 'Javascript Developer',
            office: 'San Francisco',
            age: '39',
            date: '2009/09/15',
            salary: '$205'
          },
          {
            name: 'Sonya Frost',
            position: 'Software Engineer',
            office: 'Edinburgh',
            age: '23',
            date: '2008/12/13',
            salary: '$103'
          },
          {
            name: 'Jena Gaines',
            position: 'Office Manager',
            office: 'London',
            age: '30',
            date: '2008/12/19',
            salary: '$90'
          },
          {
            name: 'Quinn Flynn',
            position: 'Support Lead',
            office: 'Edinburgh',
            age: '22',
            date: '2013/03/03',
            salary: '$342'
          },
          {
            name: 'Charde Marshall',
            position: 'Regional Director',
            office: 'San Francisco',
            age: '36',
            date: '2008/10/16',
            salary: '$470'
          },
      ],
    };

    return (
      <div>
        <MDBDataTable
          striped
          bordered
          hover
          data={data}
        />
      </div>
    );
  }
}

class Table2 extends Component {
  render() {
    const { response } = this.props;

    return (
      <div>
        <MDBDataTable
          striped
          bordered
          hover
          data={<TableBody response={response} />}
        />
      </div>
    );
  }
}

export default Table3;
